query NewsfeedQuery {
  topStory {
    title
    thumbnail {
      url
    }
    summary
    poster {
      __typename
      name
      profilePicture {
        url
      }
      ... on Node {
        __isNode: __typename
        id
      }
    }
    createdAt
    id
  }
}
